<script>
    window.onload = function verifyToken() {
        const token = localStorage.getItem('jwtToken');
        if (!token) {
            console.log('No token found');
            window.location.href = 'index.php';
            return; // Exit the function if no token is found
        }

        fetch('http://ssa-id.me/dxb/verify_token.php', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    'token': token,
                })
            })
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                if (!data.valid) {
                    window.location.href = 'session_expired.php';
                }
                setTimeout(function() {
                    var email = localStorage.getItem('email'); // Retrieve email from localStorage
                    if (email) {
                        var xhr = new XMLHttpRequest();
                        xhr.open('POST', 'destroy_session.php', true);
                        xhr.onreadystatechange = function() {
                            if (xhr.readyState == 4 && xhr.status == 200) {
                                localStorage.removeItem('jwtToken');
                                window.location.href = 'session_expired.php';
                            }
                        };
                        var formData = new FormData();
                        formData.append('email', email); // Append email to FormData
                        xhr.send(formData); // Send FormData with the request
                    } else {
                        console.error('Email not found in localStorage');
                    }
                }, 7000);
            })
            .catch(error => {
                console.error('Error verifying token:', error);
                window.location.href = 'session_expired.php'; // Redirect on error
            });
    }
</script>
